  false,\n\t\"url\": null,\n\t\"notes\": \"XBT/CTD profile comparison data from the
  oceanographic line P18 2007/2008. XBT Deployments XBTs provided by Prof. Dean Roemmich
  of SIO were dropped during the cruise for purposes of evaluating fall rate errors
  in the equations used to convert the time elapsed since an XBT enters the water
  to depth. The goals of this study, designed by Dr. Gregory C. Johnson of NOAA/PMEL,
  are to assess possible variations in the XBT fall rate equation as a function of
  ship speed and to allow comparison of co-located XBT and CTD temperature-depth profiles.
  Further information on this study can be obtained from Gregory C. Johnson (Gregory.C.Johnson@noaa.gov).\",\n\t\"license_title\":
